import "./HomePage.css";
// import React from "react";
// import Button from "./Button.js";
import React, { useState, useEffect } from "react";
import bballCourtImage from "../images/basketball-court.jpg";
import toiletImage from "../images/toilet.jpg";
import gazeboImage from "../images/gazebo.jpg";

const ImageChanger = () => {
	const [image, setImage] = useState("bballCourtImage");
};

function HomePage() {
	return (
		<div className="homepage-container">
			<img className="bballCourtImg" src={bballCourtImage} alt="bballCourt" />
			<button onClick={() => setImage("bballCourtImage")}>
				Basketball Court Installation
			</button>
			<button onClick={() => setImage("toiletImage")}>Toilet Replacement</button>
			<button onClick={() => setImage("gazeboImage")}>Gazebo Installation</button>
		</div>
	);
}

export default HomePage;
